                        "rewardForStaking_fragment8": "Reward tAPY",
                        "rewardForStaking_fragment9": " of the corresponding pool and can be increased by ",
                        "rewardTAPY_fragment1": "The Reward tAPY indicates the amount of the ",
                        "rewardTAPY_fragment10": "gWX",
                        "rewardTAPY_fragment2": "reward for staking LP tokens",
