                "buyInstructionsSkip": "If you are already familiar with AdvCash, skip this information.",
                "buyInstructionsText": "Buying USDN through AdvCash:\n\n{span}[1. No fees]\nYou buy USDN for USD at a 1:1 exchange rate. If you choose another currency, check the up-to-date USD exchange rate on the [home page](https://advcash.com/) in the currency dropdown menu in the top right.\n\n{span}[2. Quick verification]\nTo buy USDN with a card, you will need to pass a short one-time verification in AdvCash. You'll be prompted to upload a photo of your ID and proof of residence, as well as a selfie with the bank card used for the purchase and a photo of the card. This personal information will not be transferred to Waves.Exchange.\nNote. Waves.Exchange does not receive or store any of your personal data. They remain with the partners (AdvCash service).\n\n{span}[3. Instant processing]\nUSDN will be transferred to your wallet as soon as you pass the AdvCash verification (please note that in some cases the verification can take several hours to complete).\n\n{span}[4. High daily limits]\nAdvCash allows you to buy up to $8,000 worth of USDN a day (or an equivalent in any of the supported currencies).",
                "buyInstructionsTitle": "To buy USDN with a bank card, you will need to register with our partner service AdvCash. Here is some basic information about working with AdvCash. We've also prepared a detailed [step-by-step guide.](https://docs.waves.exchange/en/waves-exchange/waves-exchange-online-desktop/online-desktop-advcash)",
