                "buyWithCardInfo": "For 100 USD, you'll get exaсtly 100 USDN.\n\n3. After a successful payment on the partners' website, USDN will be credited to your account within a few minutes.\n\n4. The minimum amount is {{minValue}} USDN.\n\n5. If you have problems with your payment, please create a ticket on the ",
