                "stakingFeedback1": "Initially I was very cautious about the high yield. It took me 2 weeks to research the protocol and the contracts (I'm a very detailed and technical person). I realized that the protocol does work very well and that the rewards are based on WAVES staking. I did some calculations, all the numbers did add up, so finally I bought USDN and staked them. I think everyone should do their own analysis instead of investing in unknown coins based on advertising.",
                "stakingFeedback2": "For me, the biggest advantage is that I can get my funds back any time. I've lost a lot of crypto investments in the past because I couldn't withdraw them. With USDN, I first staked a small amount and then withdrew it. When I saw that it worked, I staked a bigger amount. Too many people are chasing high interest rates, but the really important thing is to have access to your funds when you need it. USDN lets you withdraw without penalties, whenever you want, and that's great. My only complaint is that the bank card tool with AdvCash doesn't accept cards from my country. I had to buy BTC on a different site, then transfer it to Waves.Exchange and convert it to USDN.",
                "stakingFeedback3": "I've been in the Waves community for 2 years, so when I heard about USDN, I immediately decided to start staking. A staking stablecoin is something really new for the market, something that can disrupt crypto investments. The ability to earn 12-15% transparently, with full control of your funds, without giving your coins to a centralized exchange — it's very liberating.",
                "stakingFeedback4": "I was looking for an investment vehicle that would yield more than the traditional money markets. I like USDN staking more than crypto loans, because it's much easier. The possibility to buy it with a credit card is a nice touch, as well.",
                "stakingFeedback5": "I use USDN staking as a hedging tool for my BTC trading. When I sell Bitcoin on a high, I cash into USDN and stake them. While I'm waiting for a good entry point to buy BTC again on a dip, I enjoy my USDN staking rewards. It's a much better hedging strategy than just keeping USDT or USDC coins in my wallet.",
                "stakingFeedback6": "USDN is THE most interesting staking product on the market right now, period. Great yield + zero volatility + actual decentralized protocol = a much better option than loans on Compound or those 'soft staking' things on Binance. I'm waiting for new assets on the Neutrino protocol now, like gold or RMB, will definitely stake them too.",
