                    "text8_fragment8": "ETH",
                    "text8_fragment9": " at the ",
                    "text9": "The minimum amount for USDT Staking is 1 USDT, for USDC Staking is 1 USDC.\n\nThe minimum amount for BTC Staking is 0.0001 BTC.\n\nThe minimum amount for ETH Staking is 0.07 ETH.",
